AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_116
    SET payload = LEFT(payload, 1000) + N'|V4-116|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_116;
END
